import { Formik } from "formik";
import { useTranslation } from "react-i18next";
import React from "react";
import * as Yup from "yup";

const Login = () => {
  const { t } = useTranslation();

  const Schema = Yup.object().shape({
    email: Yup.string()
      .email(`${t("text.validEmail")}`)
      .max(255)
      .required(`${t("text.requiredEmail")}`),
    password: Yup.string()
      .min(6)
      .required(`${t("text.validPassword")}`),
  });

  const initialValue = {
    email: "",
    password: "",
  };

  const handleOnSubmit = (values) => {
    console.log(values);
  };

  return (
    <div className="login-popup">
      <div className="title-group">
        <div className="main-title"></div>
        <div className="sub-title"></div>
      </div>
      <Formik
        onSubmit={handleOnSubmit}
        initialValue={initialValue}
        validationSchema={Schema}
      >
        {(props) => {
          return (
            <form
              className="form-login"
              onSubmit={props.handleSubmit}
              onKeyPress={(e) => {
                if (e.key === "Enter") e.preventDefault();
              }}
            >
              <div className="wrap-input">
                <label className="email-label">{t("text.yourEmail")}</label>
                <input
                  type="text"
                  name="email"
                  id="email"
                  className="email-input"
                  placeholder={t("text.exampleEmail")}
                />
                {props.errors &&
                props.errors.email &&
                props.errors.email !== "undefined" ? (
                  <div className="wrap-error">
                    <span className="error-mes">{props.errors.email}</span>
                  </div>
                ) : (
                  <></>
                )}
              </div>
              <div className="wrap-input">
                <label className="password-label">
                  {t("text.yourPassword")}
                </label>
                <input
                  type="password"
                  name="password"
                  id="password"
                  className="password-input"
                  placeholder={t("text.validPassword")}
                />
                {props.errors &&
                props.errors.password &&
                props.errors.password !== "undefined" ? (
                  <div className="wrap-error">
                    <span className="error-mes">{props.errors.password}</span>
                  </div>
                ) : (
                  <></>
                )}
              </div>
              <button type="submit" className="submit-btn">{t("text.loginIn")}</button>
            </form>
          );
        }}
      </Formik>
    </div>
  );
};

export default React.memo(Login);
